    import axios from 'axios';
    const response = await axios.get('http://localhost:3001/usuarios');
    const app2 = response.data;
    const apps=app2.forEach((app) => {
      const imagenBlob = app.imagen; // Obtén la imagen Blob o File
      const urlImagen = URL.createObjectURL(imagenBlob); // Crea la URL para la imagen
    
      // Asigna la URL generada a la propiedad 'imagen' en el objeto actual
      app.imagen = urlImagen;
    });
      export default apps
